import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    const isLogged = true;
    const user = 'Welcome'
    const stranger = 'Please login'

    return (
      <div className='App'>
        <h1>Hello {isLogged ? user : stranger}</h1>
      </div>
    )
  }

}

export default App;
